import { LOAD_DROPBOX_DATA } from "./types"
import axios from 'axios'
import { Dropbox } from "dropbox"

export const loadDropboxData = () => async dispatch => {
    try{
        let dbx = new Dropbox({ 
            accessToken: 'sl.BAuriOtPpEMA_28LhjbiaXgi1eiVlBrzQtVacffvsUTSLpEDBaqLrR3u8dh5r9j__LZ0MlS_Bhx5Jbq3VWmmYPyp3qEsKG9dJoQWC8lvQ6n4Q7C0AqMLTnGlO6VCuMAQWd45kbcspzvF',

          });
        dbx.filesListFolder({path: ''})
        .then(function(response) {
            console.log(response);
            let paths = response.result.entries.map(file =>({
                path: file.path_lower,
                size: "w1024h768"
            }))
            console.log(paths);
            dbx.filesGetThumbnailBatch({
                entries: paths
            }).then(res => {
                console.log(res.result.entries);
                dispatch({
                    type: LOAD_DROPBOX_DATA,
                    data: {
                        fileArray: response.result.entries,
                        thumbnail: res.result.entries
                    }
                })
            })

        })
        .catch(function(error) {
          console.error(error);
        });

    } catch(err){
        console.log('err:', err)
    }
}
